import React from 'react'
import './Tile.css' 
export default function Tile(props) {
    var tiles = []
    var counter = 0;
    for (let i=0; i<props.tileArr.length; i++){
        tiles.push([])
        let jLen = props.tileArr[i].length
        for (let j=0; j<jLen; j++){
            var letter = props.tileArr[i][j]
            if(letter){
                console.log(j,jLen)
                var radius = `5px ${j<jLen-1 ? '0px' : "5px"} ${j<jLen ? '0px' : "5px"} 5px`
                tiles[counter].push(<div className='singleTile' style={{borderRadius:radius}}>{letter}</div>)
            } else {
                tiles[counter].push(<div className='empty'></div>)
            }
        }
        counter++;
    };
    console.log(tiles)

  return (
    <>
    <div>{tiles.map((row)=>(
        <div className='row'>
        {row.map((letter)=>(
            <div>{letter}</div>
        ))}
        </div>
    ))}</div>
    {/* <div className='wholePiece'>{tiles}</div> */}
    </>
  )
}
